const App = () => {
  return (
    <div className="App">
    <div><Header/></div>
    <div><Technologies/></div>
      <ul>
        <li>css</li>
        <li>html</li>
        <li>js</li>
        <li>react</li>
      </ul>

    </div>
  );
}



export default App;
